import React, { useState, useEffect } from 'react';
import { Route, Routes, useNavigate } from 'react-router-dom';
import CompanyRegister  from './CompanyRegister';
import CompanyLogin     from './companylogin';
import StudentPage      from './studentpage';
import SCADPage         from './scadpage';
import CompanyPage      from './companypage';
import FacultyPage      from './facultypage';
import ViewRegistration from './viewregistration';

function App() {
  // Manage notification state
  const [notificationMessage, setNotificationMessage] = useState('');

  // Dummy users for login
  const dummyUsers = [
    { role: 'student', email: 'student@example.com', password: 'student123' },
    { role: 'scad',    email: 'scad@example.com',    password: 'scad123'    },
    { role: 'faculty', email: 'faculty@example.com', password: 'faculty123' },
  ];

  const [email, setEmail]       = useState('');
  const [password, setPassword] = useState('');
  const [emailError, setEmailError]     = useState('');
  const [passwordError, setPasswordError] = useState('');
  const navigate = useNavigate();

  // Handle form submission for login
  const handleLogin = (e) => {
    e.preventDefault();
    let valid = true;

    setEmailError('');
    setPasswordError('');

    const trimmedEmail    = email.trim();
    const trimmedPassword = password.trim();

    const user = dummyUsers.find(u => u.email === trimmedEmail);
    const companies = JSON.parse(localStorage.getItem('companies')) || [];
    const companyUser = companies.find(c => c.companyEmail === trimmedEmail);

    if (!user && !companyUser) {
      valid = false;
      setEmailError('Invalid email');
    } else if (user && user.password !== trimmedPassword) {
      valid = false;
      setPasswordError('Wrong password');
    } else if (companyUser && companyUser.password !== trimmedPassword) {
      valid = false;
      setPasswordError('Wrong password');
    } else if (user) {
      sessionStorage.setItem('user', JSON.stringify(user));
      if (user.role === 'student') {
        navigate('/studentpage', { state: { user } });
      } else if (user.role === 'scad') {
        navigate('/scadpage', { state: { user } });
      } else if (user.role === 'faculty') {
        navigate('/facultypage', { state: { user } });
      }
    } else {
      // no student/scad/faculty → must be company
      sessionStorage.setItem('companyUser', JSON.stringify(companyUser));
      navigate('/company-dashboard', { state: { companyUser } });
    }

    return valid;
  };

  useEffect(() => {
    // If someone is already logged in as a student/scad/faculty, redirect
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      const user = JSON.parse(storedUser);
      if (user.role === 'student')      return navigate('/studentpage');
      if (user.role === 'scad')         return navigate('/scadpage');
      if (user.role === 'faculty')      return navigate('/facultypage');
    }

    // If a companyUser session exists, redirect there
    const storedCompany = sessionStorage.getItem('companyUser');
    if (storedCompany) {
      const companyUser = JSON.parse(storedCompany);
      return navigate('/company-dashboard', { state: { companyUser } });
    }

    // Otherwise, if `companies` array has entries, take the last one as newly registered
    const arr = JSON.parse(sessionStorage.getItem('companies') || '[]');
    if (arr.length > 0) {
      const companyUser = arr[arr.length - 1];
      sessionStorage.setItem('companyUser', JSON.stringify(companyUser));
      return navigate('/company-dashboard', { state: { companyUser } });
    }
  }, [navigate]);

  return (
    <div>
      <Routes>
        <Route
          path="/"
          element={
            <CompanyLogin
              email={email}
              setEmail={setEmail}
              password={password}
              setPassword={setPassword}
              emailError={emailError}
              passwordError={passwordError}
              handleLogin={handleLogin}
            />
          }
        />

        <Route path="/company-register" element={<CompanyRegister />} />
        <Route path="/company-login"    element={<CompanyLogin />} />
        <Route path="/studentpage"      element={<StudentPage />} />
        <Route path="/scadpage"         element={<SCADPage />} />
        <Route path="/company-dashboard" element={<CompanyPage />} />
        <Route path="/facultypage"      element={<FacultyPage />} />
        <Route path="/view-registration" element={<ViewRegistration setNotificationMessage={setNotificationMessage} />} />
      </Routes>

      {notificationMessage && (
        <div style={{
          position: 'fixed',
          top: '10px', left: '50%',
          transform: 'translateX(-50%)',
          backgroundColor: '#6aabd2',
          color: 'white',
          padding: '10px',
          borderRadius: '4px'
        }}>
          {notificationMessage}
        </div>
      )}
    </div>
  );
}

export default App;
